INSERT INTO public."Product" (name,description,old_price,new_price,image,available,created_at,update_at,brand) VALUES
	 ('ALPHA PUMP Hỗ Trợ Pump Cơ Hiệu Quả','Hỗ trợ tăng cơ bắp của bạn thông qua tăng lưu lượng máu, oxy và chất dinh dưỡng – Cải thiện hiệu suất tập luyện, năng lượng và sức bền – Tăng cường kết nối từ não đến cơ bắp với nootropics liều lâm sàng ',0,800000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160546/ozwgintb3uwnekpjvpgq.jpg',40,'2024-03-10 09:28:24.981','2024-05-22 15:29:47.344','Labrada'),
	 ('LEAN BODY RTD PLANT BASED – BỮA ĂN THAY THẾ THUẦN CHAY, GIÀU PROTEIN','Bạn là người ăn chay và muốn sử dụng protein có nguồn gốc thực vật. Chúng tôi có thể đảm bảo với bạn PLANT PROTEIN sẽ mang đến hương vị thơm ngon thực sự, khả năng pha trộn tuyệt vời và kết cấu mịn..',0,1500000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160471/lmz5dgsmxju5so0ueayn.jpg',296,'2024-03-10 09:28:24.981','2024-05-21 10:52:59.363','Labrada'),
	 ('Super Huge Gain - MASS Evogen tăng cân đẳng cấp nhất','Super Huge Gain chứa 50 gram nguồn protein cao cấp hoàn chỉnh tăng trưởng cơ bắp tối đa kết hợp nguồn carb phức, giàu xơ hạn chế lên mỡ. Mass cao năng lượng tăng cân nhanh hương vị thơm ngon thanh khiết.',0,2000000,'https://www.thol.com.vn/wp-content/uploads/2019/07/Superhugemockcholateshake.jpg',33,'2024-03-10 09:28:24.981','2024-05-22 15:30:15.035','Labrada'),
	 ('ISOJECT Premium EVOGEN – Whey Isolate tăng cơ VIP nhất','Bạn là người ăn chay và muốn sử dụng protein có nguồn gốc thực vật. Chúng tôi có thể đảm bảo với bạn PLANT PROTEIN sẽ mang đến hương vị thơm ngon thực sự, khả năng pha trộn tuyệt vời và kết cấu mịn..',0,1800000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160459/s2jrr1ze4yy6jny6zucj.jpg',96,'2024-03-10 09:28:24.981','2024-05-22 15:31:32.693','Labrada'),
	 ('AMINO K.E.M Nguồn Năng lượng tập luyện cao cấp nhất','Amino K.E.M bổ sung năng lượng tập luyện sẽ giải quyết điều đó. Sản phẩm intra workout cao cấp này sẽ bổ sung năng lượng EAA+, với 9 loại acids thiết yếu tăng khả năng hồi phục cho bạn.',0,1200000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160552/glyw4tnxi3cnvl7wsy4h.jpg',63,'2024-03-10 09:28:24.981','2024-05-22 15:30:27.882','Labrada'),
	 ('Nu U Natural Astaxanthin 12mg - 180 viên','Một trong những sản phẩm chống lão hóa hàng ưu việt được nhiều người yêu thích và sử dụng đó chính là Nu U Natural Astaxanthin 12mg. Đây là viên uống bổ sung Astaxanthin - một loại sắc tố màu đỏ có trong thịt cá hồi, cua, tôm hùm và tôm có màu đỏ hồng. Hợp chất này còn gọi là caroten, giúp cho động vật giáp xác trở nên rực rỡ và sống động hơn. Nhiều nghiên cứu đã chỉ ra rằng nó có thể cải thiện sức khỏe và giải quyết các vấn đề sức khỏe tiềm ẩn.',0,400000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391329/blog-mern-typescript/wvzr0grgq0iwkiajumul.jpg',100,'2024-05-22 15:22:09.466','2024-05-22 15:22:09.466','NU U NUTRITION'),
	 ('Advanced Collagen Protein','Thực phẩm thể thao bổ sung protein hấp thụ nhanh chóng, giải pháp phục hồi cơ bắp tức thì. Advanced Collagen Protein với tác dụng đặc biệt là bổ sung collagen cải thiện độ đàn hồi da, trẻ hóa và hạn chế được vết nhăn.',1000000,900000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160485/ul0xnblmtexftgsdd04s.png',31,'2024-03-10 09:28:24.981','2024-05-21 14:32:19.574','Labrada'),
	 ('Lipo 6 Black Hers – TPBS hỗ trợ giảm cân cho nữ','Lipo 6 Black Hers giúp tăng cường quá trình trao đổi chất kích thích đốt cháy calo. Sản phẩm hỗ trợ kiểm soát sự thèm ăn giúp ngăn chặn cảm giác thèm ăn và ăn quá nhiều.',0,500000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160558/ystogoysnhw6e2rucca0.jpg',28,'2024-03-10 09:28:24.981','2024-05-22 14:20:34.695','Labrada'),
	 ('RSP AminoLean Năng lượng Gym bùng nổ','Amino thiết yếu phục hồi cơ bắp - BCAA xây dựng cơ nạc. L-Carnitine đốt mỡ và giảm đau cơ - Caffeine và Trà xanh thiên nhiên đốt mỡ và cảm nhận tốt cơ 0 đường 0 calo 0 carb - Mùi vị tuyệt vời',0,900000,'https://i.ebayimg.com/images/g/7hwAAOSwIwlmOODJ/s-l1600.webp',69,'2024-03-24 13:59:49.315','2024-05-22 15:29:57.191','Labrada'),
	 ('Ostrovit Glucosamine + MSM + Chondroitin - 90 viên','OstroVit Glucosamine MSM Chondroitin là viên uống hỗ trợ xương khớp là thực phẩm chức năng bổ sung vào chế độ ăn uống hàng ngày với Glucosamine, MSM và Chondroitin. Đây là 3 thành phần nổi tiếng trong nhiệm vụ giữ cho khớp xương luôn duy trì ở trạng thái tốt nhất.',0,700000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391175/blog-mern-typescript/evqosqcv09xoaxrsfzje.jpg',100,'2024-05-22 15:19:35.912','2024-05-22 15:19:35.912','Ostrovit ');
INSERT INTO public."Product" (name,description,old_price,new_price,image,available,created_at,update_at,brand) VALUES
	 ('Nutricost Tudca - 60 viên','Nutricost Tudca 60 viên chứa hàm lượng cao Axit Tauroursodeoxycholic (Tudca). Chất này đã được ứng dùng suốt hàng thế kỷ nhờ những công dụng tuyệt vời đối với gan và túi mật. Tudca cũng được chứng minh công dụng bảo vệ võng mạc.',0,500000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391064/blog-mern-typescript/vwv95i6srokmph6sodk8.jpg',100,'2024-05-22 15:17:44.931','2024-05-22 15:17:44.931','Nutricost '),
	 ('ISO Whey LABRADA -Whey Protein Isolate','100% Whey Protein Isolate, không chứa Gluten, không chứa Lactose, không chứa đường, ít Carbs, có chứa Glutamine hỗ trợ tốt cho việc phục hồi\n',0,1750000,'https://www.wheystore.vn/images/products/2023/12/14/large/muscle-mass-gainer-12lbs_1702547889.jpg.webp',14,'2024-03-10 09:28:24.981','2024-05-22 15:32:26.397','Labrada'),
	 ('EVL Flexmode Advanced Joint Support - 90 viên','FlexMode Advanced Joint Support là sản phẩm hỗ trợ xương khớp mới nhất đến từ hãng Evlution Nutrition của Mỹ. Sản phẩm sẽ tạo lá chắn bảo vệ xương khớp, giúp người dùng hạn chế các chấn thương khi tập luyện hay vận động mạnh.',0,900000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391245/blog-mern-typescript/aquvfpy0nv366opvpxgr.jpg',100,'2024-05-22 15:20:45.987','2024-05-22 15:20:45.987','EVL NUTRITION'),
	 ('REDCON1 MRE RTD – Thức Uống Protein Pha Sẵn Có Hương Vị Thơm Ngon Nhất','MRE® PROTEIN SHAKE có cấu hình thành phần tương tự như toàn bộ dòng MRE: nguồn protein thực phẩm toàn phần, không chứa bất kỳ whey hoặc lactose nào và hương vị thơm ngon. ',0,1400000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160501/salcgtyxnlbjbbladpbb.jpg',41,'2024-03-10 09:28:24.981','2024-05-22 15:31:11.553','Labrada'),
	 ('REDCON1 MRE Meal Replacement – Bữa ăn thay thế thơm ngon phục hồi và sửa chữa cơ hiệu quả','MRE Meal Replacement được tin dùng bởi quân đội Mỹ. Nguồn dinh dưỡng tối ưu cũng như tính tiện lợi sản phẩm giúp những người lính bổ sung tốt năng lượng sau những giờ phút hoạt động mạnh mẽ ngoài chiến trường.',0,2100000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160591/rldk2bb5etmnfwnmk6ov.png',32,'2024-03-10 09:28:24.981','2024-05-22 15:30:55.995','Labrada'),
	 ('Blackmores Coq10 150mg - 30 viên','Blackmores Coq10 150mg là viên uống bổ sung Coq10 cho cơ thể, giúp bảo vệ sức khỏe tim mạch và nâng cao sức đề kháng. Ngoài ra, sản phẩm này còn hỗ trợ chống oxy hóa, tăng cường năng lượng cho tim mạch và làm chậm quá trình lão hóa.',0,600000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391446/blog-mern-typescript/olxmvjsvqfv3xrirrzco.jpg',100,'2024-05-22 15:24:06.767','2024-05-22 15:24:06.767',' BLACKMORES'),
	 ('Orgain Collagen Peptides 1lbs','Ngủ là khoảng thời gian cơ thể nghỉ ngơi, phục hồi và đào thải độc tố. Mất ngủ không chỉ khiến cơ thể cơ thể mệt mỏi, hay cáu gắt, giảm tốc độ phục hồi cơ bắp mà còn là nguyên nhân dẫn đến nhiều căn bệnh trầm trọng.',0,700000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391539/blog-mern-typescript/gxvjv3zynjw6tuo63yxj.jpg',100,'2024-05-22 15:25:39.427','2024-05-22 15:25:39.427','Orgain');
